var map = d3.select("#map")
	.attr("width", MAP_WIDTH)
	.attr("height", MAP_HEIGHT);

var container = map.append("g")
		.attr("id", "map-handle")
		.call(zoom);

// to enable drag on all positions add rect in background with background color
container.append("rect")
	.attr("width", MAP_WIDTH)
	.attr("height", MAP_HEIGHT)
	.style("fill", "#222");

var infoText = container.append("text")
	.attr("id", "info-text")
	.attr("x", 50)
	.attr("y", 50)
	.text("")
	.append("rect")
		.attr("height", 5)
		.style("fill", "#BEF");

var countries = container.selectAll(".country")
		.data(data)
	.enter().append("g")
		.attr("class", "country")
		.on("click", function(d) { return console.log(d.name); })
		.on("mouseover", countryHover)
		.on("mouseout", countryOut);

countries.append("path")
	.attr("class", "countryPath")
	.attr("d", function(d) { return d.path; });
countries.append("text")
	.attr("class", "countryText")
	.attr("name", function(d) { return d.name; });


//--- functions ---//
function countryHover() {
	var countryPath = d3.select(this).select(".countryPath");
	var countryText = d3.select(this).select(".countryText");
	var bar = infoText.select("rect");

	bar.transition()
		.duration(1500)
		.style("fill-opacity", "0")
		.attr("width", 0);
		
	infoText.text(countryText.attr("name")).transition()
		.duration(200)
		.style("fill-opacity", "100")
		.attr("x", 50);	

	countryPath.transition()
		.duration(500)
		.style("fill", "steelblue")
		.style("stroke-width","0");
}

function countryOut() {
	var countryPath = d3.select(this).select(".countryPath");
	var countryText = d3.select(this).select(".countryText");
	var bar = infoText.select("rect");

	bar.transition()
		.duration(1500)
		.style("fill-opacity", "0")
		.attr("width", 0);

	infoText.transition()
		.duration(1500)
		.style("fill-opacity", "0")
		.attr("x", -200);

	countryPath.transition()
		.duration(500)
		.style("fill", "#ddd")
		.style("stroke-width","1");
}

//--- navigation functions ---//
function zooming() {
	container.transition()
		.duration(500)
		.attr("transform", "translate(" + d3.event.translate + ")scale(" + d3.event.scale + ")");
}